require("isomorphic-fetch");

function getTime() {
	return fetch('http://localhost:3001/list')
}

function handleError(error) {
	console.warn(error);
	return null;
}

module.exports = {
	getTimes: function() {
		return getTime().catch(handleError);
	}
};
